import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Simulate a search to reveal sort/filter controls (search for "iPhone")
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    // Click the search button (first visible .search-btn)
    const searchBtn = await page.$('.search-btn');
    if (searchBtn) {
      await searchBtn.click();
    }

    // Wait for sort/filter controls to appear
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_search.png'));

    // Locate the sort select and select "Price: Low to High"
    await page.waitForSelector('select#sortSelect', { timeout: 5000 });
    await page.selectOption('select#sortSelect', { value: 'price-low' });

    // Wait for the products to be re-sorted (just a short wait for DOM update)
    await page.waitForTimeout(500);

    // Take screenshot after applying price sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_sort_applied.png'));

    // Extract the titles and prices of the first 3 products to verify sorting
    const products = await page.$$eval('.product-card, .product-card-list', nodes =>
      nodes.slice(0, 3).map(node => {
        const title = node.querySelector('.product-title')?.textContent?.trim() || '';
        const priceText = node.querySelector('.product-price')?.textContent || '';
        const priceMatch = priceText.match(/\$([\d.,]+)/);
        const price = priceMatch ? parseFloat(priceMatch[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    return {
      success: true,
      action: "Applied 'Price: Low to High' sort filter on search results",
      extractedData: {
        topProducts: products
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
